import React from 'react'
import Typography from '@material-ui/core/Typography';

export default function ResponsiveContent(props){
    const {id} = props

    return(
        <>
            <Typography variant="h4" component="h3" gutterBottom>
                {id.title}
            </Typography>

        </>
    )
}
